import React, { useState } from 'react';
import Monsters from './monsters'
import Equipments from './equipments'

const Header = () => {
    return ( 
        <header>
            <nav>
                <a href="#" onClick={() => setContent(content)}>Monsters</a>
                <a href="#">Equipments</a>
            </nav>
        </header>
    );
}

const Main = () => {

    const [content, setContent] = useState('Monsters');

    if (content === 'Monsters') {
        return ( 
            <>
            <Header/>
            <Monsters/>
            </>
        );
    } 

    if (content === 'Equipments') {
        return (
            <>
            <Header/>
            <Equipments/>
            </>
        )
    }

}

export default Main;
